import React, { Component } from 'react'
import axios from 'axios';


class AxoisHttpCalls extends Component {

    constructor()
    {
        super();
        this.state={ 
                    users:[]
                    }

         console.log("***Constructor*****")
    }

    
    render() {
        console.log("***Render*****")
        return (<>

                <div className="container py-5">
                    <h3 className="py-3 text-center"> 
                    AXIOS RESTAPI CALLS.....  
                    <button onClick={this.handleApiData}>Click</button>
                     </h3>

                   <table className="table table-dark w-75 mx-auto my-2">
                       <thead className="table table-light">
                           <tr>
                               <th>ID</th>
                               <th>NAME</th>
                               <th>EMAIL</th>
                           </tr>
                       </thead>

                      <tbody>
                            {
                                this.state.users.map( (res,index)=>{
                                    return(<tr>
                                                    <td>{res.id}</td>
                                                    <td>{res.name}</td>
                                                    <td>{res.email}</td>
                                                    <td>{res.email}</td>
                                                    <td>{res.email}</td>
                                                    
                                            </tr>)
                                })
                            }
                    </tbody>




                   </table>
                    
                        <br /><br /><br />
                       


                </div>

        </>)
    }



    componentDidMount()
    {
        console.log("***componentDidMount*****");
        axios
        .get('https://jsonplaceholder.typicode.com/users')
        .then( (apiresult)=> this.setState({  users: apiresult.data }) )
       
    }



}

export default AxoisHttpCalls



